import React from 'react'
import { Link } from 'react-router-dom';

export const Navbar = () => {


    return (
        <nav className="navbar bg-dark">
        <h1>
          <Link to='/'><i className="fas fa-code"></i> OTP Verification</Link>
        </h1>
        
      </nav>
    )
};

export default Navbar;
